import React from "react"
import { Link } from "react-router-dom"

function Navigation(){
    return (
    <div>
        <Link to="/">홈으로</Link>
        <Link to="/login">로그인</Link>
        <Link to="/signUp">회원가입</Link>
    </div>
    );
}

export default Navigation;
